import matplotlib.pyplot as plt
import numpy as np

def plot_performance(epoch_count, model1_performance, model2_performance):
    plt.plot(epoch_count, model1_performance, label='Vanilla network')
    plt.plot(epoch_count, model2_performance, label='Depth layer network')
    plt.xlabel('Epochs')
    plt.ylabel('Root Mean Squared Error')
    plt.title('Performance Comparison of vanilla network and depth layer network on test set')
    plt.legend()
    plt.grid(True)
    plt.show()

